import { combineReducers } from 'redux'
import { createReducer } from 'redux-create-reducer';

export const TYPES = {
  SET_ERROR: 'SET_ERROR'
}

const initialState = {
  errorDescription: 'njj'
}

export const setError = (state = initialState) => (
  { type: TYPES.SET_ERROR, ...state }
)

const errorReducer = createReducer(initialState, {
  SET_ERROR: setError
})

export const reducers = combineReducers({
  errorReducer
})
